import React, { useEffect, useState } from "react";
import { getTaskList } from "../features/taskSlice";
import { useSelector, useDispatch } from "react-redux";

function Task(props) {
  const dispatch = useDispatch();
  const [tasks, setTasks] = useState([]);
  const { taskList } = useSelector((state) => state.task);
  const { token } = useSelector((state) => state.auth);
  let taskClef;
  let complete = [];

  useEffect(() => {
    dispatch(getTaskList(token));
  }, []);

  console.log(taskList);
  console.log(props.x, props.taskClef);

  if (props.taskClef === "ùÑû") {
    taskClef = "G Clef";
  }
  if (props.taskClef === "ùÑ¢") {
    taskClef = "F Clef";
  }

  console.log(taskClef, taskList[0].subcat_name);

  const res = taskList[0].subcat_name == taskClef;

  if (res === true) {
    if (complete != 0) {
      for (let i = 0; i < complete.length; i++) {
        if (
          props.x === complete[i] &&
          (taskClef === "G Clef" || taskClef === "F Clef")
        ) {
          complete[i].x = props.x;
          complete[i].clef = props.taskClef;
        } else {
          complete.push({
            x: props.x,
            clef: props.x,
          });
        }
      }
    }
  }
  console.log(complete);

  return (
    <div className="task-list">
      {taskList.map((task) => (
        <div key={task.id}>{task.name}</div>
      ))}
    </div>
  );
}

export default Task;
